INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1045121, '2020-07-06 00:00:00', 'MFund ID', 'A 5 -6 digit code as the primary identifier for all of the mutual fund reporting for both internal and external uses (e.g. fund profile pages on the G&M web have the MFund ID as part of the URL)._x000D_', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="MFund ID"][@Id=1045121]');
