INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1041343, '2020-07-06 00:00:00', 'OA Investment Company Perm ID', 'Thomson Reuters Organization Authority entity permanent identifier used to identify fund investment companies.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="OA Investment Company Perm ID"][@Id=1041343]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1032161, '2020-07-06 00:00:00', 'Owner ID', 'An internal identifier for funds and securities created in ex-Thomson databases and maintained as a cross-reference between internal databases. Also called the Thomson Central ID.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Owner ID"][@Id=1032161]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001448, '2020-07-06 00:00:00', 'PILC - Reuters', 'Primary Identifier Level Code, Unique to single entity that may have multiple RIC''s dependant on Market or Exchange.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="PILC - Reuters"][@Id=1001448]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1036941, '2020-07-06 00:00:00', 'Perm ID', 'A Lipper-generated 10-character unique identifier issued to all funds and used as the primary fund internal identifier in the SDI feed and Thomson Reuters databases.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Perm ID"][@Id=1036941]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1047280, '2020-07-06 00:00:00', 'Phoenix Fund ID', 'The Phoenix fund ID is the fund identifier used on the Phoenix database, it’s internal and does not exist externally.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Phoenix Fund ID"][@Id=1047280]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1010933, '2020-07-06 00:00:00', 'Polish RFI Code', 'A code assigned to Polish domestic funds when they register as authorized entities with the Polish Financial Supervisory Authority. RFI stands for the English equivalent of "registry number of investment funds". It is a one, two or three digit numerical code, assigned at umbrella level or at fund level, i.e. all subfunds of an umbrella have the same code. The code is published at www.knf.gov.pl/en.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Polish RFI Code"][@Id=1010933]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1006560, '2020-07-06 00:00:00', 'Portugal CMVM', 'A unique code is issued by Comissao do Mercado de Valores Mobiliarios (CMVM) (www.cmvm.pt) for all Portuguese domiciled funds.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Portugal CMVM"][@Id=1006560]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001425, '2020-07-06 00:00:00', 'RIC / Triarch Code', 'A unique identifier under which security is available on Thomson Reuters products.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="RIC / Triarch Code"][@Id=1001425]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001442, '2020-07-06 00:00:00', 'RIC / Triarch Page Code', 'A unique identifier under which security is available on Thomson Reuters products.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="RIC / Triarch Page Code"][@Id=1001442]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1040826, '2020-07-06 00:00:00', 'RIC iNAV', 'iNAV stands for Indicative or Intraday NAV. The iNAVs are calculated by stock exchanges to indicate an intraday NAV of an ETF (or other exchange traded instrument). Often, the stock exchange lists an iNAV under their Indices table.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="RIC iNAV"][@Id=1040826]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1036821, '2020-07-06 00:00:00', 'Russia FSFR Code', '', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Russia FSFR Code"][@Id=1036821]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1045960, '2020-07-06 00:00:00', 'Legal Entity Identifier', 'Unique, industry standard legal entity identifier introduced as a result of Dodd-Frank regulation. Known as LEI.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Legal Entity Identifier"][@Id=1045960]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1010633, '2020-07-06 00:00:00', 'Sedar Issuer', 'The SEDAR code identifies Canadian public securities documents and information filed by public companies and investment funds with the Canadian Securities Administrators (CSA) in the SEDAR (System for Electronic Document Analysis and Retrieval) filing system. (www.sedar.com)', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Sedar Issuer"][@Id=1010633]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001449, '2020-07-06 00:00:00', 'Sedol Code (Irish)', 'Stock Exchange Daily Official List (SEDOL) is a seven character alphanumeric identification code assigned to investment vehicles in UK and Ireland by the London Stock Exchange for clearing purposes. (http://www.londonstockexchange.com/products-and-services/reference-data/sedol-master-file/sedol-master-file.htm)', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Sedol Code (Irish)"][@Id=1001449]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001431, '2020-07-06 00:00:00', 'Sicovam Code', 'Security code used to identify securities listed on French stock exchanges. As of July 1, 2003 Sicovam codes are no longer issued.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Sicovam Code"][@Id=1001431]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001433, '2020-07-06 00:00:00', 'Taiwan Code', 'An eight-digit number assigned by the Ministry of Finance for domestic funds registered for sale in the Taiwan market. (www.mof.gov.tw)', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Taiwan Code"][@Id=1001433]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1037561, '2020-07-06 00:00:00', 'Takasbank Code', 'Takasbank (www.takasbank.com.tr) is the official Custodian, Administrator, and the National Numbering Agency for Turkey domiciled investment vehicles. It is a 3 characters alphanumerical code.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Takasbank Code"][@Id=1037561]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001444, '2020-07-06 00:00:00', 'Thailand SEC Code', 'Local indentifier assigned by the fund house.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Thailand SEC Code"][@Id=1001444]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001429, '2020-07-06 00:00:00', 'Tijd Code', 'Code issued by the data provider TIJD Beursmedia, now integrated into VWD Group www.vwd.eu. TIJD was a data provider for mainly Dutch and Belgian data: www.tijdbeursmedia.be. Only funds sourced from TIJD will have a TIJD code. Each fund record sourced from TIJD should have a unique TIJD code. Currently Lipper uses TIJD data for prices and distribution collection, but there is a self-sourcing project underway to eliminate this data provider. At that point, TIJD codes will be phased out of the database.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Tijd Code"][@Id=1001429]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001426, '2020-07-06 00:00:00', 'Valor', 'A unique global identifier issued by the Swiss agency SIX Telekurs (www.six-telekurs.com). It is an all numeric code, and is assigned to investment vehicles that SIX Telekurs is tracking.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Valor"][@Id=1001426]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001434, '2020-07-06 00:00:00', 'WKN - German', 'The Wertpapierkennnummer, (WKN, WPKN, WPK or simply Wert), is a German securities identification code. Six digits or capital letters (excluding I and O), no check digit. The first 2-4 letters may show the issuer of the instrument. The identifiers were switched from numeric to alphanumeric on 2003-07-21. The WKNs and German ISINs are provided by WM-Datenservice (www.wmdaten.de).', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="WKN - German"][@Id=1001434]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1045801, '2020-07-06 00:00:00', 'Zawya Code', 'Security code used to identify funds from across the MENA region.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Zawya Code"][@Id=1045801]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1045800, '2020-07-06 00:00:00', 'Zawya Fund ID', 'Security code used to identify funds from across the MENA region.', false, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Zawya Fund ID"][@Id=1045800]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1004862, '2020-07-06 00:00:00', 'CUSIP', 'CUSIP stands for Committee on Uniform Securities Identification Procedures and is issued by CUSIP Service Bureau, a service of Standard and Poor''s. This code is 9 digits long using alpha or numeric characters. (www.cusip.com)', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="CUSIP"][@Id=1004862]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001424, '2020-07-06 00:00:00', 'ISIN Code', 'An International Securities Identification Number (ISIN) uniquely identifies a security. Its structure is defined in ISO 6166. The ISIN code is a 12-character alpha-numerical code that does not contain information characterizing financial instruments but serves for uniform identification of a security at trading and settlement.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="ISIN Code"][@Id=1001424]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1005394, '2020-07-06 00:00:00', 'ISIN Currency Class', 'It''s a code constructed with ISIN and currency separated by dot. The ISIN.CURRENCY code helps to maintain multi currency pricing for a share class that have only one ISIN.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="ISIN Currency Class"][@Id=1005394]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1041638, '2020-07-06 00:00:00', 'Link Parent', 'The Lipper ID to which a fund is linked for pre-IPO performance. Typically, it is an older share class within the same portfolio, which has a longer performance history.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Link Parent"][@Id=1041638]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1004861, '2020-07-06 00:00:00', 'Lipper Symbol (LANA Code)', 'Internal Lipper symbol originating from the Dstar database used in the US.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Lipper Symbol (LANA Code)"][@Id=1004861]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1045161, '2020-07-06 00:00:00', 'MFund Family ID', '', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="MFund Family ID"][@Id=1045161]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001435, '2020-07-06 00:00:00', 'NASDAQ Ticker', 'Identification code used by the NASDAQ stock exchange.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="NASDAQ Ticker"][@Id=1001435]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1009424, '2020-07-06 00:00:00', 'Primary Exchange Ticker', 'A ticker used on the primary stock exchange.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Primary Exchange Ticker"][@Id=1009424]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1000026, '2020-07-06 00:00:00', 'RIC', 'A list of all Reuters Instrument Codes(RIC) related to the fund.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="RIC"][@Id=1000026]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001420, '2020-07-06 00:00:00', 'Sedol Code', 'Stock Exchange Daily Official List (SEDOL) is a seven character alphanumeric identification code assigned to securities in UK and Ireland by the London Stock Exchange for clearing purposes. (http://www.londonstockexchange.com/products-and-services/reference-data/sedol-master-file/sedol-master-file.htm)', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="Sedol Code"][@Id=1001420]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1014579, '2020-07-06 00:00:00', 'US CIK', 'The Central Index Key (CIK) to identify entities, including US fund investment companies, that have filed disclosures with the SEC.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="US CIK"][@Id=1014579]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1001436, '2020-07-06 00:00:00', 'US Fund No', '', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="US Fund No"][@Id=1001436]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1004012, '2020-07-06 00:00:00', 'US Fund No', 'The US Fund No is automatically assigned by the US based databases. This data field is populated by the US data feeds. Each fund record domiciled in the US and sourced from US systems will have a unique US Fund No.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="US Fund No"][@Id=1004012]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1004013, '2020-07-06 00:00:00', 'US Portfolio No', 'A Lipper-generated numeric identifier issued to US funds that are part of the same portfolio. Feeders investing in one master will have the same Portfolio No, even though they may be unrelated.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="US Portfolio No"][@Id=1004013]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1014581, '2020-07-06 00:00:00', 'US SEC Class ID', 'For Fund Investment Companies (FIC) with multiple funds, an SEC identifier in addition to the CIK, which identifies an individual fund within the FIC.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="US SEC Class ID"][@Id=1014581]');
INSERT INTO reference_data.cross_reference_codes (cross_ref_type_id, create_timestamp, cross_ref_type_name, definition, status, update_timestamp, xpath) VALUES (1014580, '2020-07-06 00:00:00', 'US SEC Series ID', 'For fund investment companies ("FIC") with multiple funds, an SEC identifier in addition to the CIK, which identifies a particular share class of a fund within the FIC.', true, '2020-07-06 00:00:00', '/Feed/AssetOverview/Portfolio/Holdings/Holding/CrossReferenceCodes/Code[@Type="US SEC Series ID"][@Id=1014580]');
